cs:\n    var data_ml = src_ml.data;\n    var data_al = src_al.data;\n    var data_lb = src_lb.data;\n    // var data_ei = src_ei.data;\n    // var data_ep = src_ep.data;\n\n    var T = data_lb['T']\n    // var Ei = data_ei['Ei']\n    // var Ep = data_ep['Ep']\n\n    // vars from callback:\n    var Txx = Txx.value;\n    var Txy = Txy.value;\n    var Tyy = Tyy.value;\n    var Tm = (Txx+Tyy)/2;\n\n    // Set phi = 0, if any spinner is used:\n    var Txx_tmp = data_al['Txx_tmp'];\n    var Txy_tmp = data_al['Txy_tmp'];\n    var Tyy_tmp = data_al['Tyy_tmp'];\n    if ( Txx != Txx_tmp || Txy != Txy_tmp || Tyy != Tyy_tmp ){\n        Txx_tmp[0]=Txx;\n        Txy_tmp[0]=Txy;\n        Tyy_tmp[0]=Tyy;\n        phi.value=0;\n        \n    }\n\n    var phi = phi.value;\n\n    // Multiline cyan:\n    var C = data_ml['C'];\n    var S = data_ml['S'];\n    var X = data_ml['X'];\n    var Y = data_ml['Y'];\n    var XS = data_ml['XS'];\n    var YS = data_ml['YS'];\n\n    // Little Circle black:\n    var x = data_al['x']\n    var y = data_al['y']\n    var xm = data_al['xm']\n    var ym = data_al['ym']\n\n    // label at little circle:\n    var x_lbl = data_lb['x']\n    var y_lbl = data_lb['y']\n\n    // CS green:\n    var EX = data_al['EX']\n    var EY = data_al['EY']\n\n    // CS blue:\n    var ex = data_al['ex']\n    var ey = data_al['ey']\n\n    // Eigen:\n    var evx = data_al['evx']\n    var evy = data_al['evy']\n    var phi1 = data_al['phi1']\n    var phi1deg = data_al['phi1deg']\n    var start = data_al['start']\n    var end = data_al['end']\n    var start_X = data_al['start_X']\n    var end_X = data_al['end_X']\n    var minx = data_al['minx']\n    var maxx = data_al['maxx']\n\n    // AnnularWedge blue:\n    var xa = data_al['xa']\n    var ya = data_al['ya']\n    var pa = data_al['pa']\n    var pad = data_al['pad']\n    var pad2 = data_al['pad2']\n    var px = data_al['px']\n\n    // red:\n    var outer_radius = data_al['outer_radius']\n    var inner_radius = data_al['inner_radius']\n    var start_angle = data_al['start_angle']\n    var end_angle = data_al['end_angle']\n\n\n    if ( phi &gt;= 0.0 ){\n        var start_angle = data_al['start_angle']\n        var end_angle = data_al['end_angle']\n    }\n    else {\n        var start_angle = data_al['end_angle']\n        var end_angle = data_al['start_angle']\n    }\n\n    // -----------------------------------------\n    // -----------------------------------------\n    // -----------------------------------------\n\n    // Multiline cyan:\n    for (var i = 0; i &lt; C.length; i++) {\n        X[i] =   Tm + (Txx - Tyy)*C[i]/2 + Txy*S[i];\n        Y[i] =      - (Txx - Tyy)*S[i]/2 + Txy*C[i];\n    }\n    for (var i = 0; i &lt; XS.length-1; i++) {\n        XS[i] = [X[i],X[i+1]];\n        YS[i] = [Y[i],Y[i+1]];\n    }\n    var i_last = XS.length - 1;\n    XS[i_last] = [X[i_last],X[0]];\n    YS[i_last] = [Y[i_last],Y[0]];\n\n    // Little Circle black:\n    var dMP = [Txx-Tm, Txy]\n    var dMPm = [Tyy -Tm, -Txy]\n\n    phi *= Math.PI/180\n    var psi = - 2*phi\n\n    var c1 = Math.cos(psi)\n    var s1 = Math.sin(psi)\n    var Q1 = [[c1, -s1], [s1, c1]]\n\n    var c2 = Math.cos(phi)\n    var s2 = Math.sin(phi)\n    var rP = [0,0];\n    var rPm = [0,0];\n\n    for (var j = 0; j &lt; 2; j++) {\n       for (var i = 0; i &lt; 2; i++) {\n          rP[j]  += Q1[j][i]*dMP[i];\n          rPm[j] += Q1[j][i]*dMPm[i];\n       }\n    }\n    x[0] = rP[0] + Tm;\n    y[0] = rP[1];\n    xm[0] = rPm[0] + Tm;\n    ym[0] = rPm[1];\n\n    x_lbl[0] = rP[0] + Tm;\n    y_lbl[0] = rP[1];\n\n    // label below:\n    var txx = x[0].toFixed(2);\n    var txy = y[0].toFixed(2);\n    var tmp = \"(\"\n    var tmp = tmp.concat(txx.toString());\n    var tmp = tmp.concat(\", \");\n    var tmp = tmp.concat(txy.toString());\n    var tmp = tmp.concat(\")\");\n    T[0] = tmp;\n\n    // CS blue:\n    outer_radius[0] = Math.sqrt((0.5*(Txx - Tyy))**2 + Txy**2);\n\n    // Eigen:\n    evx[0][0] = Tm - outer_radius[0];\n    evx[0][1] = Txx_tmp;
